/*Table structure for table `applymoneylog` */

DROP TABLE IF EXISTS `applymoneylog`;

CREATE TABLE `applymoneylog` (
  `fd_id` varchar(36) NOT NULL,
  `fd_money` int(11) DEFAULT NULL COMMENT '申请提现金额',
