  `id` varchar(36) NOT NULL,
  `fd_connect` varchar(1000) DEFAULT NULL COMMENT '提出的问题',
  `fd_createtime` datetime DEFAULT NULL COMMENT '提问时间',
  `fd_creater` varchar(36) DEFAULT NULL COMMENT '提问人ID',
  `fd_name` varchar(100) DEFAULT NULL COMMENT '提问人用户名',
  `fd_kfread` varchar(5) DEFAULT NULL COMMENT '客服查看 0、未读  1、已读',
  `fd_useread` varchar(5) DEFAULT NULL COMMENT '用户查看 0、未读  1、已读',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk;

