  `fd_id` varchar(36) NOT NULL,
  `fd_money` int(11) DEFAULT NULL COMMENT '充值金额',
  `fd_userid` varchar(36) DEFAULT NULL COMMENT '用户ID',
  `fd_username` varchar(500) DEFAULT NULL COMMENT '会员名',
