  `fd_ordertype` varchar(36) DEFAULT NULL COMMENT '支付平台',
  `fd_commit` varchar(250) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`fd_id`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk;

